import React, {createContext} from 'react';

const UserContext = React.createContext({
    isLoggedIn: false,
    Email: '',
    UserType: '',
    setEmail: () => {},
    setUsertype: () => {},
    setFirstname: () => {},
    login: () => {},
    logout: () => {}
});

export default UserContext
